import React from "react";
import "./Menu.css";

function Menu() {
  return (
    <>
      <h6 className="FMH6">Menus</h6>
      <a href="#" className="aAbout">
        About
      </a>
      <a href="#" className="aHome">
        Home
      </a>
      <a href="#" className="aService">
        Service
      </a>
    </>
  );
}

export default Menu;
